import apiURL from "../apiUrl";
import axios from "axios";

const userListURL = apiURL + "user/list/";

const getUserById = (pk) => {
  let user;
  console.log(axios.get(userListURL + pk).then((res) => res.data.username));
  console.log(user);
  return user ? user : "Anonymous";
};

export default getUserById;
